import React from 'react';
import Tilty from 'react-tilty';
import "./Logo.css";


const Logo = () => {

    let style1 = {
        background: "linear-gradient(89deg, #EC7063 0%, #45B39D 100%);"
    };

    return (

       <div className="ma4 mt0">
        <Tilty className="tilty shadow-2" glare scale={1.05} maxGlare={0.5} glareStyle={style1}>
         <div className="inner">
           What the frak?
             </div>

        </Tilty>
        </div>


    );
}

export default Logo
